Листинг 2.6. Использование инструкции цикла for() 
class UsingFor{ 
public static void main(String[] args){// Индексная переменная: 
int i; 
// Переменная для вычисления суммы: 
int sum=0; 
// Инструкция цикла: 
for(i=1;i<=100;i++){ 
sum+=i;} 
System.out.println("Сумма чисел от 1 до 100: "+sum);} 
} 
Программой вычисляется сумма натуральных чисел от 1 до 100. Для этого вво- 
дится целочисленная переменная sum, которая инициализируется с начальным  
нулевым значением — в эту переменную записывается значение суммы. Вы- 
числение суммы осуществляется посредством инструкции цикла. В нем исполь- 
зуется целочисленная индексная переменная i. Объявляется переменная вне  
инструкции цикла. В первом блоке (блок инициализации) индексной перемен- 
ной присваивается значение 1. Проверяется условие i<=100, то есть инструкция  
цикла выполняется до тех пор, пока значение индексной переменной не превы- 
сит значение 100. В теле инструкции цикла переменная sum увеличивается на  
текущее значение индексной переменной i. В третьем блоке инструкции цикла  
командой i++ значение индексной переменной увеличивается на единицу. 
Последней командой программы выводится сообщение о значении суммы. В ре- 
зультате выполнения программы мы получаем сообщение: 
Сумма чисел от 1 до 100: 5050 
Чтобы посчитать сумму нечетных чисел в указанном диапазоне, в третьем бло- 
ке изменения индексной переменной команду i++ достаточно заменить коман- 
дой i+=2. Кроме того, индексную переменную можно инициализировать прямо  
в первом блоке инструкции цикла. Пример измененной программы для вычис- 
ления суммы нечетных чисел приведен в листинге 2.7. 
Листинг 2.7. Вычисление суммы нечетных чисел 
class UsingFor2{ 
public static void main(String[] args){ 
// Переменная для вычисления суммы: 
int sum=0; 
// Инструкция цикла: 
for(int i=1;i<=100;i+=2){ 
sum+=i;} 
System.out.println("Сумма нечетных чисел от 1 до 100: "+sum);} 
} 
В результате выполнения программы получаем: 
Сумма нечетных чисел от 1 до 100: 2500 
Как уже отмечалось, первый блок инициализации и третий блок изменения  
индексной переменной могут состоять из нескольких команд. В листинге 2.8приведен пример программы для вычисления суммы нечетных чисел, в которой  
команды инициализации переменных и команда основного тела инструкции  
цикла включены соответственно в первый и третий блоки инструкции цикла. 
Листинг 2.8. Сумма нечетных чисел 
class UsingFor3{ 
public static void main(String[] args){ 
int sum,i; 
// Инструкция цикла: 
for(sum=0,i=1;i<=100;sum+=i,i+=2); 
System.out.println("Сумма нечетных чисел от 1 до 100: "+sum);} 
} 
Индексная переменная i и переменная sum объявляются вне инструкции цикла.  
Инициализируются обе переменные в первом блоке. Условие выполнения ин- 
струкции цикла не изменилось. Третий блок состоит из двух команд: команды  
sum+=i, предназначенной для увеличения значения переменной sum на величину  
i, и команды i+=2, изменяющей значение индексной переменной. Тело инструк- 
ции цикла не содержит команд, поэтому после закрывающей круглой скобки  
стоит точка с запятой. Результат выполнения программы такой же, как и в пред- 
ыдущем случае. Отметим несколько принципиальных моментов. 
‰ Если переменные sum и i объявить в инструкции цикла, доступными они  
будут только в пределах этой инструкции. С индексной переменной i в этом  
случае проблем не возникает, а вот последняя команда программы, в которой  
имеется ссылка на переменную sum, оказывается некорректной. 
‰ Имеет значение порядок следования команд в третьем блоке инструкции цикла.  
Если команды sum+=i и i+=2 поменять местами, сначала будет изменяться зна- 
чение индексной переменной, а затем на это новое значение увеличиваться  
переменная sum. В результате сумма будет вычисляться не от 1, а от 3. 
